// App.js
import React from 'react';

class App extends React.Component {
  handleClickYes = () => {
    alert('You are eligible for Google Home');
  };

  handleClickNo = () => {
    alert('Still, you will win Google Home');
  };

  render() {
    return (
      <div style={{ textAlign: 'center', marginTop: '200px' }}>
        <h2>Are you STROMWISE?</h2>
        <div style={{ marginTop: '20px' }}>
          <button style={{ marginRight: '20px' }} onClick={this.handleClickYes}>
            Yes
          </button>
          <button onClick={this.handleClickNo}>No</button>
        </div>
      </div>
    );
  }
}

export default App;
